import React from "react";

function HelloDiv() {
  return (
  <div class = "container">
    <h1>Hello! My name is Harsh</h1>
    <ul>
      <li>Pizza</li>
      <li>Sports</li>
      <li>Sleeping</li>
    </ul>
  </div>
  );
}

export default HelloDiv;
